import React from "react";
import ReactDOM from "react-dom";
import SkillSet from "./SkillSet";
import "../componentCss/SkillListCss.css";

class SkillList extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="grid wide">
        <SkillSet
          skillName="Oriented Object Programming"
          skillDescription="lorem ipsum"
        />

        <SkillSet
          skillName="Cấu trúc dữ liệu và giải thuật"
          skillDescription="lorem ipsum"
        />

        <SkillSet
          skillName="HTML5, CSS3, ES6 và hơn thế nữa!"
          skillDescription="lorem ipsum"
        />

        <SkillSet
          skillName="ReactJS, Bootstrap 4, VueJS cùng jQuery"
          skillDescription="lorem ipsum"
        />
      </div>
    );
  }
}

export default SkillList;
